import React from "react";

function Clock() {

  const hours = new Date().getHours();

  switch(hours) {
    case hours < 12:
      return <p>Good Morning!</p>;
    case 12 < hours && hours < 18:
      console.log(hours);
      return <p>Good Afternoon!</p>;
    case hours > 18:
      return <p>Good Evening!</p>;
    default:
      return <p>Not a valid time</p>
  }
}

export default Clock;
